import { useState } from "react";
import  logo from "../media/logo.png" ;
import { Link } from "react-router-dom";


export default function Navbar() {

  const  [active, setactive] = useState(false);

  const handleActive=()=>{
    setactive(!active);
  }

 
  return (
    <div className={active ? "navbar active" : "navbar"}  onClick={handleActive}>
      <Link style={{textDecoration:"none"}} to="/"><div className="navbar__logo"><img src={logo} alt="logo" /></div></Link>
        

        <ul className="navbar__links ">
       
          <Link style={{textDecoration:"none"}} to="about"><li>about me</li> </Link>
    
    
          <Link style={{textDecoration:"none"}} to="mail"><li>mail me</li> </Link>
     
      
          <Link style={{textDecoration:"none"}} to="resume"><li>download resume</li> </Link>
      
        </ul>   

        <div className={active ? "navbar__ham active" : "navbar__ham"}  onClick={handleActive}>
            <div></div>
            <div></div>
            <div></div>
        </div>
    </div>
  )
}
